import React from "react";
import { Card, Space, Table } from 'antd';

export default function OcReport() {
    const columns = [
        {
            title: 'Name',
            dataIndex: 'name',
            key: 'name',
            render: text => text,
        },
        {
            title: 'Age',
            dataIndex: 'age',
            key: 'age',
        },
        {
            title: 'Address',
            dataIndex: 'address',
            key: 'address',
        },
        {
            title: 'Action',
            key: 'action',
            render: (text, record) => (
                <Space size="middle">
                    <a>View</a>
                    <a>Aproove</a>
                </Space>
            ),
        },
    ];
    const data = FAKE_DATA.LIST_OF_PROJECTS;

    return (
        <>
            <Card>
                <Table
                    columns={columns}
                    dataSource={data}
                />
            </Card>
        </>
    );
}
